  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Aransas National Wildlife Refuge Complex for
  the next 15 years. This plan outlines the Refuge vision and purpose and describes
  how the Complex will contribute to the overall mission of the Refuge System. The
  plan provides an introduction to the Refuge, an overview of the CCP process, Refuge
  facilities and public use programs, a summary of Refuge resources, goals and objectives,
  alternatives, current management programs, strategies for implementation, and administration.\",\n\t\"license_title\":
